import { indexConverter } from './indexConverter'
import { currencies } from './currencies'
import { userManager } from './user'
import {combineReducers} from 'redux'

const rootReducer = combineReducers({
    indexConverter,
    currencies,
    userManager
});
export default rootReducer;
